INSERT INTO `exercise_calories` VALUES (1,4.84,'배구','https://www.youtube.com/embed/_yL4RrVUCmg','유연성과 순발력, 민첩성, 팔과 다리의 근력 및 지구력과 발달','스포츠',NULL,'전신'),(2,5.06,'골프','https://www.youtube.com/embed/LSpFSIVtnzQ','지구력향상, 심장과 하체에 엄청난 자극과 발달','스포츠',NULL,'지구력'),(3,5.72,'스키','https://www.youtube.com/embed/woobSulmn9Y','유산소 운동효과','스포츠',NULL,'전신'),(4,5.94,'자전거','https://www.youtube.com/embed/vnjvNplPZ8Y','대퇴부나 허리 근력을 키울 수 있고 팔과 배등에도 운동 효과','하체',NULL,'허벅지'),(5,7.26,'등산','https://www.youtube.com/embed/JGlZdp06p0c','하체 강화, 심폐기능 향상, 신진대사 촉진, 스트레스 해소','하체',NULL,'허벅지'),(6,7.7,'수영','https://www.youtube.com/embed/nzMQE6ZodC0','지구력, 근력, 심혈관 건강','스포츠',NULL,'전신'),(7,9.45,'축구','https://www.youtube.com/embed/cR9Dspq-Kjo','하체 근력을 강화, 심페지구력 능력 향상','스포츠',NULL,'하체'),(8,8.29,'농구','https://www.youtube.com/embed/3G2CgH4TQF0','심폐지구력과 순발력을 향상','스포츠',NULL,'전신'),(9,9.24,'조깅','https://www.youtube.com/embed/3NNTmi_s5PA','신진대사를 크게 증진, 노화 예방','다이어트',NULL,'다리'),(10,5.25,'야구','https://www.youtube.com/embed/KgILjKH_T1I','상체 근력을 향상, 순발력 향상','스포츠',NULL,'상체'),(11,9.1,'버피테스트','https://www.youtube.com/embed/Uukm_JpUcRg','코어 근육을 포함한 하체 근육, 상체 근육 골고루 발달','다이어트',NULL,'전신'),(12,4.25,'계단 오르기','https://www.youtube.com/embed/4plMVmZkdQg','온몸의 근육이 강화되는데, 특히 척추부터 허리, 엉덩이, 허벅지, 종아리로 이어지는 하체 근육이 단련','하체',NULL,'허벅지'),(13,4.31,'윗몸 일으키기','https://www.youtube.com/embed/tfwbpv6gCbg','복근을 발달','상체',NULL,'복근'),(14,5.68,'스쿼트','https://www.youtube.com/embed/Fk9j6pQ6ej8','전신 근육을 발달, 지방 연소','하체',NULL,'전신'),(15,4.55,'요가','https://www.youtube.com/embed/_aLF5C40hY8','스트레스를 감소, 자존감 향상','다이어트',NULL,'전신'),(16,12.5,'줄넘기','https://www.youtube.com/embed/eYbh3thSMu4','몸의 전체 근육을 단련, 폐활량 증가','다이어트',NULL,'전신'),(17,4.2,'아령','https://www.youtube.com/embed/y2WUr_Bv2UE','근력운동은 불안과 우울증 완화에 효과가 있는 것으로 나타났으며 자존감도 향상','상체',NULL,'팔'),(18,3.98,'걷기','https://www.youtube.com/embed/YRAqrulD7YI','심장병 예방 효과, 다이어트 효과','다이어트',NULL,'다리'),(21,3.5,'자동차 수리',NULL,'자동차 전문 기술 향상 및 전신 근육 발달','기타',NULL,'기타'),(22,7,'배드민턴',NULL,'신속한 스텝, 점프 및 몸의 회전 등을 필요로 하는 배드민턴은 전신 운동이라고 볼 수 있습니다. 이는 심폐기능의 향상은 물론 근육 발달, 몸의 탄력 향상','스포츠',NULL,'전신'),(24,2.5,'볼링',NULL,'전신운동 하체로 볼링공의 무게를 지탱하며 팔, 어깨, 허리 등을 사용하여 스텝을 밟아 스윙하는 동작을 하므로 전신 운동에 효과적','스포츠',NULL,'전신'),(25,12,'권투',NULL,'유산소운동과 근력운동인 무산소 운동을 함께하는 이상적인 운동이다. 특히 단위 시간에 많은 에너지를 소비해 체중감량에도 매우 효과적이다. 또 복싱 동작은 허리∙어깨∙팔∙다리의 말초 근육을 발달시켜 군살을 제거하는 데 이상적','스포츠',NULL,'상체'),(26,3,'서킷 트레이닝',NULL,'지방분해 효소를 활성화해 체지방을 감량해주기 때문이다. 오랜 시간에 걸쳐 힘든 근력운동을 하지 않기 때문에 근육 피로도가 낮다.','상체',NULL,'전신'),(27,11,'암벽 등반',NULL,'산소·무산소 운동 효과를 동시에 얻을 수 있는 장점이 있다. 순간적인 파워와 근지구력을 모두 요구하는 종목으로 전신의 근력을 고르게 발달시킬 수 있다. 단순한 근력 이용 뿐만 아니라 동작에 대한 이해와 고도의 집중력으로 두뇌발달 효과','기타',NULL,'기타'),(28,11,'롤러블레이드',NULL,'유산소 운동으로 심폐 기능이 많이 향상되며 달리기 동작보다 발과 무릎 관절에 부담을 덜 줍니다. 또한 대퇴근 및 종아리 근육 발달은 물론 균형 감각도 많이 향상','기타',NULL,'기타'),(29,4,'탁구',NULL,'민첩성, 순발력, 판단력 등을 기르는데 좋으며 폐활량도 늘릴 수 있어 성인병 예방에도 효과','스포츠',NULL,'전신'),(30,5,'테니스',NULL,'테니스는 유산소적이면서도 무산소적인 운동 효과가 동시에 나타난다. 코트 내에서의 부단한 움직임은 유산소 운동 효과를, 동시에 공을 받기 위해 정확히 라켓을 뻗는 집중력, 순발력, 그리고 판단력은 무산소 운동 효','스포츠',NULL,'전신'),(32,4.9,'점핑 잭',NULL,'전신 근력 향상 및 탄력 증진 효과, 점핑 잭 운동 동작은 간단해 보이지만 꽤 높은 강도의 운동으로, 칼로리 소모에 아주 효과적','하체',NULL,'허벅지'),(33,8.3,'킥복싱',NULL,'킥복싱은 몸의 균형, 힘, 민첩성을 향상시키는데 효과가 있다','스포츠',NULL,'전신'),(34,8.8,'턱걸이',NULL,'풀업은 상체를 집중적으로 가꿀 수 있는 운동으로써 군살을 제거하고 역삼각형 라인을 만드는 데 도움을 주는데요. 등 근육을 담당하는 광배근과 어깨 근육, 가슴 근육, 팔의 이두 및 삼두근, 복부 근육까지 발달시키며, 두툼한 가슴과 넓은 어깨를 만들 수 있음','상체',NULL,'등'),(35,5.5,'팔굽혀펴기',NULL,'전체 근육 활성화 팔굽혀펴기는 이두박근, 중추근육, 삼두근, 삼각근 및 하체 근육과 같은 신체의 모든 주요 근육을 움직이며, 몸을 지탱하는 코어 근육 발달','상체',NULL,'팔'),(36,3.5,'삽으로 눈 치우기',NULL,'상체 근력 발달 및 인내심 향상','기타',NULL,'기타'),(38,10.1,'태권도',NULL,'태권도의 운동 형태는 신체를 균형 있게 구사하도록 짜여 있어, 인체 관절의 유연성이 고르게 발달한다.','스포츠',NULL,'하체'),(45,2.5,'레슬링',NULL,'전신 근육을 발달','스포츠',NULL,'전신'),(46,6.2,'벨리 댄스',NULL,'상체와 하체의 밸런스를 잡아줌으로써 여성에겐 최적의 미와 건강을 주는 운동효과','기타',NULL,'기타'),(47,4.5,'장작 패기',NULL,'상체 근력 발달','기타',NULL,'기타'),(23,10.5,'당구',NULL,'정신적 노화를 막고 지력을 높여주는 효과','스포츠',NULL,'전신'),(56,3.75,'Test',NULL,'좋음','내가 추가한 운동',23,'상체');
